import React, {Component} from 'react';
import './App.css';
import './burger-menu.css';
import menu from './pp-menu.json';
import logo from './logo.jpg';
import { slide as Menu } from 'react-burger-menu';
import resources from './resources.json';

class RestaurantMenu extends Component {

  showSettings (event) {
    event.preventDefault();


  }


  constructor(props) {
    super(props);
    this.state = {
      menu: menu
    };
  }

  render() {
    console.log(this.state.menu);

    return (
      <div className="RestaurantMenu">
        <div className="menu-container">
          <div className="page-title-container"><h1>Meny</h1></div>
          <div className="menu-entry-container">
            <h2>Pasta Pesto</h2>
            <p>Pasta, pesto, basilika</p>
          </div>
          <div className="menu-entry-container">
            <h2>Pasta Pesto</h2>
            <p>Pasta, pesto, basilika</p>
          </div>
          <div className="menu-entry-container">
            <h2>Pasta Pesto</h2>
            <p>Pasta, pesto, basilika</p>
          </div>
          {menu.ppmenu.map(item => (
             <div>{item.title}
               <RestaurantMenuItem item={item} />
             </div>             

          ))}

        </div>
      </div>
    );    
  }

}

export default RestaurantMenu;

const RestaurantMenuList = ({ list }) => (
  <RestaurantMenuList>
    {list.map(item => (
      <RestaurantMenuItem item={item} />
    ))}
  </RestaurantMenuList>

);


const RestaurantMenuItem = ({ item }) => (
  <RestaurantMenuItem >
    <div className="menu-entry-container">
      <h2>{item.title} - {item.price} kr</h2>
      <p>{item.description}</p>
    </div>
  </RestaurantMenuItem>
);
